import React from "react";

const ImageLinkForm = () => {
    return (
       <div className="ma4 mt0">
         <Tilt className="Tilt br2 shadow-2" options={{ max: 40 }} style={{ height: 150, width: 150}}>
            <div className="Tilt-inner pa3">
                <img alt='Logo' src={brain}/> 
            </div>
        </Tilt>
       </div>
    );
}

export default ImageLinkForm;
